import classes from "./Header.module.css";
import { authActions } from "../store";

const Header = () => {
  const menuItems = (
    <>
      <li>
        <a href="/">My Products</a>
      </li>
      <li>
        <a href="/">My Sales</a>
      </li>
      <li>
        <button>Logout</button>
      </li>
    </>
  );
  return (
    <header className={classes.header}>
      <h1>Redux Auth</h1>
      <nav>
        <ul>
          {authActions.isAuthenticated && menuItems}
          {!authActions.isAuthenticated && <li><button>Logout</button></li>}
        </ul>
      </nav>
    </header>
  );
};

export default Header;
